import { FaFacebook } from 'react-icons/fa';

const SocialFollow = () =>{
    return(
        <>
          <div className="contact-us-flag">
            <a href="#">contact us</a>
            <FaFacebook/>
           {/* <div className="antfb-icons"><FacebookFilled/></div>
           <div className="antinsta-icons"><InstagramOutlined /></div> */}
          </div>
        </>
    ) 
};
export default SocialFollow;
